import "./CharacterStat.css";

function CharacterStat(values) {
  return (
    <div className="character-stat-grid">
        <div className="character-stat-grid">
          <img className="character-stat-icon" src="./gem.webp"/>
        </div>
    </div>
  );
}
export default CharacterStat;
